import ListGroup from 'react-bootstrap/ListGroup';
import CartItem from './cart';

export default function CartList(props){
    return(
    <ListGroup as="ol">
        <ListGroup.Item as="li">Cras justo odio</ListGroup.Item>
        <ListGroup.Item as="li">Cras justo odio</ListGroup.Item>
        <CartItem name={props.cart[0].image}/>
        <CartItem name='hiii'/>
        <ListGroup.Item as="li">Cras justo odio</ListGroup.Item>
      </ListGroup>
    );
}
